import React, { useState } from "react";
import axios from "axios";
import "./Excel.css";

function App() {
  const [file, setFile] = useState(null);
  const [subOrderNo, setSubOrderNo] = useState("");
  const [filterResult, setFilterResult] = useState(null);

  const [data, setData] = useState({
    all: 0,
    rto: 0,
    door_step_exchanged: 0,
    delivered: 0,
    profit: 0,
    totalPrice: 0,
  });

  const handleFileUpload = (e) => {
    setFile(e.target.files[0]);
  };

  const handleSubmit = async () => {
    if (!file) {
      alert("Please upload a file first!");
      return;
    }

    const formData = new FormData();
    formData.append("file", file);

    try {
      const response = await axios.post("http://localhost:5000/upload", formData);
      setData(response.data);
    } catch (error) {
      console.error("Error uploading file:", error);
    }
  };

  const handleFilter = async () => {
    if (!subOrderNo) {
      alert("Please enter Sub Order No!");
      return;
    }

    try {
      const response = await axios.get(
        `http://localhost:5000/filter/${subOrderNo}`
      );
      setFilterResult(response.data);
    } catch (error) {
      console.error("Error filtering data:", error);
    }
  };

  const handleSubmitAll = async () => {
    try {
      await axios.post("http://localhost:5000/submit-all");
      alert("All data submitted to MongoDB successfully!");
    } catch (error) {
      console.error("Error submitting all data:", error);
    }
  };

  const handleDownloadPDF = async () => {
    try {
      const response = await axios.get("http://localhost:5000/download-pdf", {
        responseType: "blob",
      });

      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "report.pdf");
      document.body.appendChild(link);
      link.click();
      link.remove();
    } catch (error) {
      console.error("Error downloading PDF:", error);
    }
  };

  return (
    <div className="App">
      <h1>Excel File Upload & Analysis</h1>

      {/* Upload Section */}
      <input type="file" onChange={handleFileUpload} />
      <button onClick={handleSubmit}>Submit</button>

      {/* Summary Section */}
      <div className="summary">
        <p>📦 All Products: {data.all}</p>
        <p>🚚 Delivered: {data.delivered}</p>
        <p>🔄 RTO: {data.rto}</p>
        <p>🏠 Door Step Exchanged: {data.door_step_exchanged}</p>
        <p>💰 Profit: ₹{data.profit}</p>
        <p>💵 Total Price: ₹{data.totalPrice}</p>
      </div>

      {/* Filter Section */}
      <div className="filter">
        <input
          type="text"
          placeholder="Enter Sub Order No"
          value={subOrderNo}
          onChange={(e) => setSubOrderNo(e.target.value)}
        />
        <button onClick={handleFilter}>Filter</button>
      </div>

      {/* Filter Result */}
      {filterResult && (
        <div className="filter-result">
          <h3>Filter Result</h3>
          <pre>{JSON.stringify(filterResult, null, 2)}</pre>
        </div>
      )}

      {/* Submit All + Download PDF - Centered */}
      <div
        style={{
          marginTop: "20px",
          display: "flex",
          gap: "10px",
          justifyContent: "center", // ✅ Center horizontally
        }}
      >
        <button
          onClick={handleSubmitAll}
          style={{
            backgroundColor: "#28a745",
            color: "#fff",
            padding: "10px 20px",
            border: "none",
            borderRadius: "6px",
            cursor: "pointer",
            fontSize: "14px",
          }}
        >
          Submit All (Upload & Save)
        </button>

        <button
          onClick={handleDownloadPDF}
          style={{
            backgroundColor: "#007bff",
            color: "#fff",
            padding: "10px 20px",
            border: "none",
            borderRadius: "6px",
            cursor: "pointer",
            fontSize: "14px",
          }}
        >
          Download PDF
        </button>
      </div>
    </div>
  );
}

export default App;
